CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "authentication_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" bigint NOT NULL REFERENCES "authentication_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "authentication_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" bigint NOT NULL REFERENCES "authentication_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "authentication_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "park_platform" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "leprix" varchar(200) NULL, "startPrice" integer NOT NULL, "monthPrice" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "park_thecity" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "reservation_reservation" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "start_time" datetime NOT NULL, "end_time" datetime NOT NULL, "price" decimal NOT NULL, "is_active" bool NOT NULL, "parking_area_id" bigint NOT NULL REFERENCES "park_parkingarea" ("id") DEFERRABLE INITIALLY DEFERRED, "slot_id" bigint NOT NULL REFERENCES "park_slot" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "authentication_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "park_lostrequest" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "parking_area" varchar(100) NOT NULL, "date" date NOT NULL, "photo" varchar(100) NOT NULL, "description" text NULL, "response" text NULL, "user_id" bigint NOT NULL REFERENCES "authentication_user" ("id") DEFERRABLE INITIALLY DEFERRED, "is_responded" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "park_slot" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "slot_number" integer NOT NULL, "status" bool NOT NULL, "area_id" bigint NOT NULL REFERENCES "park_parkingarea" ("id") DEFERRABLE INITIALLY DEFERRED, "is_booked" bool NOT NULL, "occupied_by_id" bigint NULL REFERENCES "authentication_user" ("id") DEFERRABLE INITIALLY DEFERRED, "created_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "park_parkingarea" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "esp_id" varchar(10) NOT NULL, "location" varchar(500) NOT NULL, "slots" integer NOT NULL, "occupancy" integer NOT NULL, "photo" varchar(100) NOT NULL, "workingtime" varchar(100) NULL, "pricelvl1" integer NULL, "pricelvl2" integer NULL, "pricelvl3" integer NULL, "city_id" bigint NULL REFERENCES "park_thecity" ("id") DEFERRABLE INITIALLY DEFERRED, "share_location" varchar(250) NOT NULL);
CREATE TABLE IF NOT EXISTS "stats_message_contact" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "sender" varchar(100) NOT NULL, "body" text NOT NULL, "created_at" datetime NOT NULL, "email" varchar(50) NOT NULL);
CREATE TABLE IF NOT EXISTS "authentication_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "first_name" varchar(150) NOT NULL, "last_name" varchar(150) NOT NULL, "email" varchar(100) NULL UNIQUE, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "phone_number" integer NULL UNIQUE, "bio" varchar(250) NULL, "photo" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "stats_notification" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "header" varchar(100) NOT NULL, "body" text NOT NULL, "created_at" datetime NOT NULL, "image" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "park_foundobject" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "description" text NOT NULL, "image" varchar(100) NOT NULL, "parking_area_id" bigint NOT NULL REFERENCES "park_parkingarea" ("id") DEFERRABLE INITIALLY DEFERRED, "date_found" date NOT NULL, "name" varchar(100) NULL);
